'''YOOOOO'''是一个长久以来流传的口号，是望见一位女生相貌的人下半身部分出现男性特征的欢呼

实际使用时，其中“O”的数量可以任意延长，并加任意數量的叹号，如：

YOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOO！！！

Yooooo本身是针对[[伪娘]]的，之后使用范围扩大，有各种基情的画面的均可适用。其实并不应对[[百合]]使用，但是近期使用的人越来越多。

{{黑幕|yo在西班牙语里是“我”的意思，所以在使用西班牙语的人群面前请慎重行事。}}

==用语的走红==

一位名叫Young Buck的网友在观看了《[[Pico|Pico系列]]》的三集动画后（他误以为片名为Boku）感到十分震撼，在[[YouTube娘|Youtube]]上传的吐槽视频《Don't Watch an anime called "Boku"》（《千万不要看那个名为“Boku”的动漫》）引起了大量网友关注，片子的一系列句子（包括“Yooooo”，“THREEEEEE”，“像是把灵魂卖给[[路西法(用语)|路西法]]”）从而广为流传。

